import React from "react";
import { Link } from "react-router-dom";
import "./DonorOrNGO.css";
function DonorOrNGO() {
  return (
    <div className="container10">
      <div className="screen__content">
        <h1>SIGN UP</h1>
        <Link to="/suD">
          <button className="button login__submit">DONOR</button>
        </Link>
        <Link to="/suN">
          <button className="button login__submit">NGO</button>
        </Link>
        <h1>LOG IN</h1>
        <Link to="/liD">
          <button className="button login__submit">DONOR</button>
        </Link>
        <Link to="/liN">
          <button className="button login__submit">NGO</button>
        </Link>
      </div>
    </div>
  );
}
export default DonorOrNGO;
